from __future__ import absolute_import, print_function, unicode_literals, division

from jormungandr.instance import Instance
from shapely import wkt


good_geom = wkt.loads(
    "MULTIPOLYGON(((-4.4392 48.1514,-4.4392 47.7647,-3.8881 47.7647,-3.8881 48.1514,-4.4392 48.1514)))"
)


class FakeInstance(Instance):
    def __init__(self, geom):
        self.geom = geom
        self.name = "test"


def has_point_test():
    instance = FakeInstance(good_geom)
    assert instance.has_coord(-4.0392, 48.0514)
    assert not instance.has_coord(-2.0392, 48.0514)

    # same test with a invalid poly
    geom = wkt.loads(bad_poly)
    instance = FakeInstance(geom)
    assert not instance.has_coord(-3.427663, 47.736798)


def update_geojson_test():
    instance = FakeInstance(good_geom)
    instance._update_geojson()
    assert instance.geojson
    assert instance.geojson['type'] == 'Polygon'
    assert instance.geojson['coordinates'] == (
        ((-4.4392, 48.1514), (-4.4392, 47.7647), (-3.8881, 47.7647), (-3.8881, 48.1514), (-4.4392, 48.1514)),
    )

    instance.geom = None
    instance._update_geojson()
    assert instance.geojson is None


def update_bad_geojson_test():
    geom = wkt.loads(bad_poly)
    instance = FakeInstance(geom)
    instance._update_geojson()
    assert not instance.geojson


